// Return a list of viewable items
// Instead of using the item.hasPermission(Item.READ)
// to return a list of items that are readable

if (authorizationStrategy instanceof AuthorizationStrategy.Unsecured) {
    return new ArrayList(items.values());
}
if (authorizationStrategy instanceof FullControlOnceLoggedInAuthorizationStrategy) {
    return new ArrayList(items.values());
}


// if the authorizationStrategy is not one of those listed above, 
// then the returned jobs are filtered by the permission of the current user

if (authorizationStrategy instanceof AuthorizationStrategy.Unsecured) {
    return new ArrayList(items.values());
}


    // FIXED:
    List<TopLevelItem> viewableItems = new ArrayList<TopLevelItem>();
    for (TopLevelItem item : items.values()) {
        if (item.hasPermission(Item.READ))
            viewableItems.add(item);
    }
    return viewableItems;
}

